<template>
	<view class="loginPage">
		<statusBar></statusBar>
		<view class="header-wrap common-pa-30">
			<view class="text-color-white">
				<uni-icon type="closeempty" size="36" @click="goBack"></uni-icon>
			</view>
			<view class="title uni-h2 uni-center text-color-white">
				嬴魚
			</view>
			<view class="tabs">
				<view class="uni-flex">
					<view class="loginTab uni-flex-item uni-center" :class="currentTab=='login'?'actived':''" @tap="changeTab('login')">
						<text>登录</text>
						<view class="triangle-icon"></view>
					</view>
					<view class="vertical-line"></view>
					<view class="registerTab uni-flex-item uni-center" :class="currentTab=='reg'?'actived':''" @tap="changeTab('reg')">
						<text>注册</text>
						<view class="triangle-icon"></view>
					</view>
				</view>
			</view>
		</view>

		<!-- 登录模块 -->
		<view class="content common-pa-30" v-if="currentTab == 'login'">
			<view class="input-wrap">
				<view class="input-item">
					<input type="number" maxlength="11" v-model="loginData.phone" placeholder="请输入手机号" data-val="phone" />
				</view>
				<view class="input-item has-label-right uni-flex">
					<input type="password" v-model="loginData.password" class="input-left uni-inline-item" placeholder="请输入密码"
					 data-val="password" />
					<view class="label-right uni-inline-item" style="border:none;" @tap="toForgetPassword">
						忘记密码？
					</view>
				</view>
			</view>

			<view class="btn-primary">
				<button @tap="bindLogin">登 录</button>
			</view>

			<!-- 第三方登录 -->
			<view class="oauth-wrap common-pa-30" v-if="hasProvider" v-bind:style="{top: positionTop + 'px'}">
				<view class="oauth-title uni-flex">
					<view class="oauth-title-item line">

					</view>
					<view class="oauth-title-item text">
						使用第三方账号登录
					</view>
					<view class="oauth-title-item line">
						
					</view>
				</view>
				<view class="oauth-row uni-flex">
					<view class="oauth-image" v-for="provider in providerList" :key="provider.value">
						<image :src="provider.image" @tap="oauth(provider.value)"></image>
					</view>
				</view>
			</view>
		</view>
		<!-- 注册模块 -->
		<view class="content common-pa-30" v-if="currentTab == 'reg'">
			<view class="input-wrap">
				<view class="input-item">
					<input placeholder="用户名" v-model="registerData.username" />
				</view>
				<view class=" input-item">
					<input type="number" maxlength="11" v-model="registerData.phone" placeholder="请输入手机号" class="is-input1 " data-val="phone" />
				</view>
				<view class="input-item has-label-right uni-flex">
					<input type="number" class="input-left" placeholder="验证码" v-model="registerData.code" />
					<view class="label-right" @tap="getsmscode">
						<text :style="{color:smsbtn.status?'#333':'#999'}">{{smsbtn.text}}</text>
					</view>
				</view>
				<view class="input-item">
					<input placeholder="输入密码" type="password" v-model="registerData.password" maxlength="16" />
				</view>
				<view class="input-item">
					<input placeholder="确认密码" type="password" v-model="registerData.password1" maxlength="16" />
				</view>
				<view class="input-item">
					<input placeholder="推荐人ID (必填)" v-model="registerData.inviteCode" />
				</view>
			</view>
			
			<view class="btn-primary">
				<button @tap="bindRegister">注 册</button>
			</view>
		</view>
	</view>
</template>

<script>
	import {
		uniIcon
	} from '@dcloudio/uni-ui';
	import _ from 'lodash';
	import {
		mapMutations
	} from 'vuex';
	import service from '../../common/userService.js';
	import util from '../../common/util.js';

	export default {
		components: {
			uniIcon
		},
		data() {
			return {
				loginData: {
					phone: "",
					password: ""
				},
				registerData: {
					username: "",
					phone: "",
					password: "",
					password1: "",
					code: "",
					inviteCode: "",
					msg: "",
					expiryTime: ""
				},
				currentTab: "login",
				smsbtn: {
					text: '获取验证码',
					status: true,
					codeTime: 60
				},
				providerList: [],
				hasProvider: true,
				positionTop: 0,
				targetPageIndex: 0
			}
		},
		methods: {
			// 注入vuex的方法
			...mapMutations(['LOGIN', 'INIT_GOODS', 'INIT_ADDRESS', 'INIT_ORDERLIST']),
			// 初始化第三方登录图标
			initProvider() {
				// const filters = ['weixin', 'qq', 'sinaweibo'];
				const filters = ['weixin'];
				uni.getProvider({
					service: 'oauth',
					success: (res) => {
						if (res.provider && res.provider.length) {
							_.forEach(res.provider, item => {
								if (~filters.indexOf(item)) {
									this.providerList.push({
										value: item,
										image: `/static/img/login/icon_login_${item}@2x.png`
									});
								}
							})
							this.hasProvider = true;
						}
						console.log(JSON.stringify(res));
						console.log(JSON.stringify(this.providerList))
					},
					fail: (err) => {
						console.error('获取服务供应商失败：' + JSON.stringify(err));
					}
				});
			},
			initPosition() {
				/**
				 * 使用 absolute 定位，并且设置 bottom 值进行定位。软键盘弹出时，底部会因为窗口变化而被顶上来。
				 * 反向使用 top 进行定位，可以避免此问题。
				 */
				this.positionTop = uni.getSystemInfoSync().windowHeight - 150;
			},
			// 第三方登录
			oauth(value) {
				uni.login({
					provider: value,
					success: (res) => {
						uni.getUserInfo({
							provider: value,
							success: (infoRes) => {
								/**
								 * 实际开发中，获取用户信息后，需要将信息上报至服务端。
								 * 服务端可以用 userInfo.openId 作为用户的唯一标识新增或绑定用户信息。
								 */
								this.goBack();
							}
						});
					},
					fail: (err) => {
						console.error('授权登录失败：' + JSON.stringify(err));
					}
				});
			},
			// 切换tab
			changeTab(tab) {
				this.currentTab = tab;
			},
			// 点击登录
			bindLogin() {
				// 定义校验列表
				const checkList = [{
					name: "phone",
					rules: [{
						checkType: "notnull",
						name: "phone",
						errorMsg: "请输入手机号"
					}, {
						checkType: "phoneno",
						name: "phone",
						errorMsg: "请输入正确的手机号"
					}]
				}, {
					name: "password",
					rules: [{
						checkType: "notnull",
						name: "password",
						errorMsg: "请输入密码"
					}]
				}];
				// 校验数据
				let isUserInvalid = false;
				_.forEach(checkList, (item) => {
					const isValid = this.isValidFn(item.name, item.rules, "loginData");
					if (!isValid) {
						uni.showToast({
							icon: 'none',
							title: util.graceChecker.error
						});
						isUserInvalid = true;
						return false;
					}
				})
				if (isUserInvalid) {
					return
				}

				const parms = {
					phone: this.loginData.phone,
					password: _.trim(this.loginData.password)
				};
				// 登录
				uni.showLoading({
					title: '加载中...'
				});
						uni.setStorageSync("USER_TOKEN", "");
				service.login(parms).then(res => {
					if(res.data.code=="200")
					{
						// 请求成功
						uni.hideLoading();
						const data = res.data.result;
						const token = res.data.msg;
						// 缓存用户token
						uni.setStorageSync("USER_TOKEN", token);
						/* // 用户角色等级
						const userLevel = data.role || 0;
						// 获取购物车数据
						this.getCartList(data.id);
						// 获取收货地址
						this.getAddress(data.id);
						// 获取订单列表数据
						this.getOrderList(data.id);
						// 设置底部导航栏
						this.setfooterBar(userLevel); */
						// 缓存用户信息
						data.userName = data.tuser.userName ? data.tuser.userName : 'PY_' + data.tuser.phone;
						uni.setStorageSync('USERS_INFO', data);
						// 同步store里面的用户名称，等级
						this.LOGIN(data);
						// 返回上一页面
						this.goBack();
					}
					else
					{
						uni.hideLoading();
						uni.showToast({
							icon: 'none',
							title: res.data.msg,
						});
						return;
					}
					
				}).catch((err) => {
					// 请求失败
					console.log(err)
					uni.hideLoading();
					uni.showToast({
						icon: 'none',
						title: err.message,
					});
					return;
				})
			},
			// 校验数据是否合法
			isValidFn(name, rules, dataType) {
				let data = {};
				data[name] = this[dataType][name];
				return util.graceChecker.check(data, rules);
			},
			// 点击注册
			bindRegister() {
				// 定义校验列表
				const checkList = [{
						name: "username",
						rules: [{
							checkType: "notnull",
							name: "username",
							errorMsg: "用户名不能为空"
						}]
					},
					{
						name: "phone",
						rules: [{
							checkType: "notnull",
							name: "phone",
							errorMsg: "请输入手机号"
						}, {
							checkType: "phoneno",
							name: "phone",
							errorMsg: "请输入正确的手机号"
						}]
					}, {
						name: "code",
						rules: [{
							checkType: "notnull",
							name: "code",
							errorMsg: "短信验证码不能为空"
						}, {
							checkType: "same",
							checkRule: this.registerData.msg,
							name: "code",
							errorMsg: "短信验证码不正确"
						}]
					}, {
						name: "expiryTime",
						rules: [{
							checkType: "dateless",
							checkRule: new Date(),
							name: "expiryTime",
							errorMsg: "短信验证码已过期"
						}]
					}, {
						name: "password",
						rules: [{
							checkType: "notnull",
							name: "password",
							errorMsg: "请输入密码"
						}]
					}, {
						name: "password1",
						rules: [{
							checkType: "notnull",
							name: "password1",
							errorMsg: "确认密码不能为空"
						}, {
							checkType: "same",
							checkRule: this.registerData.password,
							name: "password1",
							errorMsg: "两次密码输入不一致"
						}]
					}, {
						name: "inviteCode",
						rules: [{
							checkType: "notnull",
							name: "inviteCode",
							errorMsg: "推荐人ID不能为空"
						}]
					}
				];
				// 校验数据
				let isUserInvalid = false;
				_.forEach(checkList, (item) => {
					const isValid = this.isValidFn(item.name, item.rules, "registerData");
					if (!isValid) {
						uni.showToast({
							icon: 'none',
							title: util.graceChecker.error
						});
						isUserInvalid = true;
						return false;
					}
				});
				if (isUserInvalid) {
					return
				}

				const parms = {
					username: this.registerData.username,
					phone: this.registerData.phone,
					password: _.trim(this.registerData.password),
					code: this.registerData.code,
					inviteCode: this.registerData.inviteCode
				}
				uni.showLoading({
					title: '注册中'
				});
				service.register(parms).then(res => {
					if(res.data.code=="200")
					{
						uni.hideLoading();
						util.alert({
							// title:'注册',
							content: "恭喜您,注册成功!",
							success: () => {
								// 切换到登录tab
								this.changeTab('login');
								// 将手机号带到登录tab中
								this.loginData.phone = this.registerData.phone;
								// 清空注册数据
								this.registerData = {
									username: "",
									phone: "",
									password: "",
									password1: "",
									code: "",
									inviteCode: ""
								}
							}
						})
					}
					else{
					uni.hideLoading();
					// 请求失败
					util.alert({
						// title:'注册',
						content: res.data.msg,
						success: () => {
						}
					})
					return;
					}
				}).catch((err) => {
					uni.hideLoading();
					// 请求失败
					uni.showToast({
						icon: 'none',
						title: res.data.msg,
					});
					return;
				})
			},
			// 获取验证码
			getsmscode() {
				// 定义校验列表
				const checkList = [{
					name: "phone",
					rules: [{
						checkType: "notnull",
						name: "phone",
						errorMsg: "请输入手机号"
					}, {
						checkType: "phoneno",
						name: "phone",
						errorMsg: "请输入正确的手机号"
					}]
				}];
				// 校验数据
				let isUserInvalid = false;
				_.forEach(checkList, (item) => {
					const isValid = this.isValidFn(item.name, item.rules, "registerData");
					if (!isValid) {
						uni.showToast({
							icon: 'none',
							title: util.graceChecker.error
						});
						isUserInvalid = true;
						return false;
					}
				});
				if (isUserInvalid) {
					return
				}

				if (this.smsbtn.status) {
					const parms = {
						phone: this.registerData.phone
					}
					service.getSms(parms).then(res => {
						this.registerData.msg = res.data.msg
						this.registerData.expiryTime =new Date().setMinutes(new Date().getMinutes() + 10);
						uni.showToast({
							icon: 'none',
							title: '验证码已发送,请注意查收!',
						});
						this.timerId = setInterval(() => {
								this.smsbtn.status = false;
								var codeTime = this.smsbtn.codeTime;
								codeTime--;
								this.smsbtn.codeTime = codeTime;
								this.smsbtn.text = codeTime + "S";
								if (codeTime < 1) {
									clearInterval(this.timerId);
									this.smsbtn.text = "重新获取";
									this.smsbtn.codeTime = 60;
									this.smsbtn.status = true;
								}
							},
							1000);
					}).catch((err) => {
						// 请求失败
						uni.showToast({
							icon: 'none',
							title: err.errMsg,
						});
						return;
					});
				}
			},
			//  购物车商品列表分两步查询，先查询产品ids，再通过ids查询产品详细信息
			// 先查询产品ids
			getCartList(userId) {
				uni.showLoading();
				service.getCartList(userId).then(res => {
					uni.hideLoading();
					const data = res.data.data.data;
					if (data.length > 0) {
						// 通过ids批量查询商品详情
						this.getCartListDetail(data);
					} else {
						// 同步购物车数据;
						this.INIT_GOODS([]);
					}
				}).catch(err => {
					uni.hideLoading();
					uni.showToast({
						icon: 'none',
						title: err.errMsg,
					});
				})
			},
			// 通过ids查询产品详细信息
			getCartListDetail(cartData) {
				// 配置查询ids数组
				let goodsId = []
				_.forEach(cartData, item => {
					goodsId.push(item.goodsId);
				})
				uni.showLoading();
				service.getGoodListById({
					ids: goodsId
				}).then(res => {
					uni.hideLoading();
					let data = res.data.data;

					// 需要对比的数组
					let contrastArr = [];
					_.forEach(data, item => {
						contrastArr.push(item.id);
					})
					// 筛选哪些产品失效了
					let removedGoods = this.getRemovedGoods(goodsId, contrastArr);
					let goodsList = [];
					// 组建购物车产品列表
					_.forEach(cartData, item => {
						// 判断当前产品是否失效
						let removedIndex = this.getIndex(item.goodsId, removedGoods, "");
						// 获取购物车中当前产品在详情数组中的下标
						let currentIndex = this.getIndex(item.goodsId, data, "id");
						// 查询是否有相应的规格
						let standardIndex = this.getIndex(item.standardId, data[currentIndex].standard, "id");
						goodsList.push({
							scrollLeft: 0,
							// 是否被选中
							isChecked: false,
							// 商品是否不能选中
							isDisabled: removedIndex > -1 ? true : (standardIndex > -1 ? false : true),
							// 数据id，删除时有用
							id: item.id,
							// 商品id
							goodsId: item.goodsId,
							// 商品数量
							num: item.num,
							// 规格id
							standardId: item.standardId,
							// 价格  下架展示为空，未下架优先展示规格里面的单价
							price: removedIndex > -1 ? "" : (standardIndex > -1 ? data[currentIndex].standard[standardIndex].price :
								data[currentIndex].price),
							// 商品标题
							title: removedIndex > -1 ? "亲，所选商品已经下架了哦" : data[currentIndex].title,
							// 规格描述
							standardText: removedIndex > -1 ? "" : (standardIndex > -1 ? data[currentIndex].standard[standardIndex].title :
								""),
							// 商品是否失效, 实时查询的产品无此规格，则表示商品失效
							isInvalid: standardIndex > -1 ? false : true,
							imageUrl: removedIndex > -1 ? "/static/img/logo@0.5x.png" : util.setImageUrl({
								type: "goods",
								goodId: item.goodsId,
								imageName: standardIndex > -1 ? (data[currentIndex].standard[standardIndex].imageUrl || data[
									currentIndex].imageUrl) : data[currentIndex].imageUrl
							})[0].img,
						})
					})
					// 同步购物车数据;
					this.INIT_GOODS(goodsList);
				}).catch(err => {
					console.log(err)
					uni.hideLoading();
					uni.showToast({
						icon: "none",
						title: err.errMsg,
					})
				})
			},
			// 根据id查询对应下标
			getIndex(id, arr, key) {
				return key ? _.findIndex(arr, item => id === item[key]) : _.findIndex(arr, item => id === item);
			},
			// 筛选哪些产品失效了
			getRemovedGoods(arr, arr2) {
				return _.difference(arr, arr2)
			},
			// 获取收货地址数据
			getAddress(userId) {
				if (!userId) {
					return
				}
				let params = {
					userId: userId,
				}
				uni.showLoading({
					title: "加载中"
				})
				// 获取用户收获地址列表
				service.getAddressList(params).then(res => {
					uni.hideLoading();
					let data = res.data.data;
					if (data.length > 0) {
						this.INIT_ADDRESS(data);
					}
				}).catch(err => {
					uni.hideLoading();
					uni.showToast({
						icon: "none",
						title: err.errMsg,
					})
				})
			},
			// 获取订单列表
			getOrderList(userId) {
				if (!userId) {
					return
				}
				let params = {
					userId: userId,
					status: "", // 查询全部
					page: 1,
					pageSize: 1000
				}
				uni.showLoading({
					title: "加载中"
				})
				// 获取用户收获地址列表
				service.getOrderList(params).then(res => {
					uni.hideLoading();
					let data = res.data.data.data;
					if (data.length > 0) {
						this.INIT_ORDERLIST(data);
					}
				}).catch(err => {
					uni.hideLoading();
					uni.showToast({
						icon: "none",
						title: err.errMsg,
					})
				})
			},
			// 忘记密码页面
			toForgetPassword() {
				uni.navigateTo({
					url: "/pages/login/pwd"
				})
			},
			// 设置不同的tabbar
			setfooterBar(userLevel) {
				// 用户等级大于1的才能看到会员中心
				let barType = userLevel >= 1 ? "menu_5" : "menu_4";
				// 触发设置导航
				this.$store.dispatch(barType);
				// 切换导航下标
				this.$store.dispatch("change_page", this.pageCode);
			},
			// 返回登录前一页
			goBack() {
				// 获取页面栈数组
				const pages = getCurrentPages();
				if (pages.length > 1) {
					uni.navigateBack({
						animationType: 'slide-out-bottom',
					});
				} else {
					// 跳转到首页
					this.$store.dispatch("change_page", "home");
					uni.reLaunch({
						url: "/pages/index"
					})
				}

			}
		},
		onLoad(option) {
			this.initProvider();
			this.initPosition();
			// 获取路由参数
			this.loginData.phone = option.phone || "";
			this.loginData.password = option.password || "";
			this.pageCode = option.pageCode;
